.header {
  padding: 40px $largePaddingX 200px;

  @include forDesktop {
    padding: 40px $tabletPaddingX 100px;
  }

  @include forTablet {
    padding: 23px $tabletPaddingX 100px;
  }

  @include forMobile {
    padding: 20px $mobilePaddingX 100px;
  }

  &__wrapper-content {
    // display: grid;
    // grid-template-columns: repeat(12, 1fr);

    @include limitContentWidth;

    position: relative;

    @include forDesktop {
      // display: grid;
      // grid-template-columns: repeat(3, 1fr);
    }

    @include forMobile {
      // display: grid;
    }
  }

  &__section {
    display: grid;
    grid-template-columns: repeat(12, 1fr);
    // display: grid;
    // grid-template-columns: repeat(12, 1fr);
    // justify-content: space-between;
    align-items: center;

    @include forDesktop {
      // grid-template-columns: repeat(12, 1fr);
      // display: flex;
      // justify-content: space-between;
      margin-bottom: 30px;
      padding: 0;
    }

    @include forTablet {
      display: flex;
      justify-content: space-between;
      margin-bottom: 30px;
      padding: 0;
    }

    @include forMobile {
      grid-column: 1 / -1;
      display: flex;
      justify-content: space-between;
      margin-bottom: 20px;
      padding: 0;
    }
  }

  &__burger {
    display: none;

    @include forTablet {
      grid-column: 1;
      display: block;
    }

    @include forMobile {
      grid-column: 1;
      display: block;
    }
  }

  &__logo {
    display: flex;
    align-items: center;

    gap: 12px;
    grid-column: 1 / 5;

    @include forTablet {
      grid-column: 3 / 4;
    }
  }

  &__main-logo {
    @include forTablet {
      width: 24px;
      height: 24px;
    }

    @include forMobile {
      width: 24px;
      height: 24px;
    }

    transition: transform 0.5s ease-in;
    &:hover {
      transform: rotate(720deg);
    }
  }

  &__logo-text {
    @include fontParams(14px, 130%);
    letter-spacing: 0.05em;
    text-transform: uppercase;
    color: #344f10;

    @include forMobile {
      display: none;
    }

    @include forTablet {
      display: none;
    }
  }

  .nav {
    grid-column: 7 / 10;

    &__list {
      list-style: none;
      display: flex;
      gap: 40px;
      position: relative;

      padding-left: 20px;
    }

    &__link {
      @include fontParams(18px, 150%, 500);
      color: #344f10;
      position: relative;

      padding-bottom: 5px;
      &::before {
        content: "";
        position: absolute;
        width: 100%;
        height: 2px;
        border-radius: 4px;
        background-color: $textColor;
        bottom: 0;
        left: 0;
        transform-origin: right;
        transform: scaleX(0);
        transition: transform 0.3s ease-in-out;
      }

      &:hover::before {
        transform-origin: left;
        transform: scaleX(1);
      }
    }

    @include forTablet {
      display: none;
    }

    @include forMobile {
      display: none;
    }
  }

  &__cart {
    grid-column: -1;
    text-align: right;
    // margin-right: 10px;
  }

  &__cart-mobile {
    @include forTablet {
      width: 17px;
      height: 20px;
    }

    @include forMobile {
      width: 20px;
      height: 24px;
    }

    transition: transform 0.1s ease-in;
    &:hover {
      transform: scale(1.1);
    }
  }

  &__brand {
    display: flex;
    grid-template-columns: repeat(12, 1fr);
    column-gap: 20px;
    margin-top: 92px;

    @include forDesktop {
      display: grid;
      grid-template-columns: repeat(12, 1fr);
      // display: flex;
      // flex-direction: column-reverse;
      // gap: 50px;
      // margin-top: 0;
    }

    @include forTablet {
      display: flex;
      flex-direction: column-reverse;
      gap: 50px;
      margin-top: 0;
    }

    @include forMobile {
      display: flex;
      flex-direction: column-reverse;
      gap: 13px;
      margin: 0 auto;
    }
  }

  &__main-image {
    @include forDesktop {
      max-width: 100%;
      height: 500px;
    }

    @include forTablet {
      width: 100%;
      height: 500px;
    }

    @include forMobile {
      width: calc(100% + 40px);
      height: 267px;
    }

    transition: transform 0.5s ease-in;
    &:hover {
      cursor: pointer;
      transform: scale(0.9);
    }
  }

  &__main-col-1 {
    grid-column: 2 / 5;

    @include forDesktop {
      grid-column: 2 / 7;
      max-width: 480px;
      margin: 0 auto;
    }

    @include forTablet {
      grid-column: 1 / 6;
      margin: 0 auto;
    }

    @include forMobile {
      grid-column: 1 / -1;
      width: 280px;
      height: 197px;
      margin: 0 auto;
    }
  }

  &__main-col-2 {
    grid-column: 7 / 12;

    @include forDesktop {
      grid-column: 7 / -1;
    }
  }

  &__title {
    @include fontParams(60px, 130%, 600);
    margin: 0;

    color: $textColor;

    @include forTablet {
      grid-column: 2 /  5;
      max-width: 466px;

      @include fontParams(36px, 150%, 600);
      text-align: center;
    }

    @include forMobile {
      @include fontParams(24px, 130%, 600);
      text-align: center;
    }
  }

  &__sale-text {
    @include fontParams(16px, 150%, 400);
    color: $textColor;
    margin-top: 30px;
    margin-bottom: 50px;

    @include forTablet {
      grid-column: 2 /  4;

      text-align: center;
      margin-top: 10px;
      margin-bottom: 50px;
    }

    @include forMobile {
      text-align: center;
      margin-top: 10px;
      margin-bottom: 30px;
    }
  }

  &__shop-text {
    @include fontParams(16px, 130%, 600);

    letter-spacing: 0.15em;
    text-transform: uppercase;
    color: $buttonColor;

    width: 280px;
    height: 60px;

    display: flex;
    justify-content: center;
    align-items: center;

    transition: background 0.3s ease-in;

    background-color: $textColor;

    &:hover {
      color: $textColor;
      background: $buttonColor;
      box-shadow: 0 0 11px rgba(33,33,33,0.2);
    }

    @include forTablet {
      margin: 0 auto;
    }

    @include forMobile {
      margin: 0 auto;
    }
  }
}

